import styled from "styled-components";
import {NavLink} from 'react-router-dom';

function Category() {
  return (
    <List>
        <NavLink to={'/cuisine/Pescetarian'}>
            <h4>Pescetarian</h4>
        </NavLink>
        <NavLink to={'/cuisine/Pescetarian'}>
            <h4>Lacto Vegetarian</h4>
        </NavLink>
        <NavLink to={/cuisine/}>
            <h4>Ovo vegetarian</h4>
        </NavLink>
        <NavLink to={/cuisine/}>
            <h4>Vegan</h4>
        </NavLink>
        <NavLink to={/cuisine/}>
            <h4>Vegetarian</h4>
        </NavLink>
    </List>
  )
}


const List = styled.div`
display: flex;
justify-content: cebter;
margin: 2rem 0rem;

`

export default Category
